import React from 'react'
import { useEffect,useState } from 'react'

let handlesubmit = (e) => {
    e.preventDefault();

    if (username == "mehdi" && password == "haidri") {
        window.location.pathname = ""
    }


}


function Login() {
    let [username, setusername] = useState();
    let [password, setpassword] = useState();





  return (
      <div>
          <form  onSubmit={handlesubmit}>
               username  : <input type='text' name='username' onChange={()=>setusername(username) } value = {username} />
               pasword :  <input type='password' name='password' onChange={()=>setpassword(password) } value = {password}/>
              <input type='submit'/>
         </form>
     </div>
  )
}

export default Login
